import React from "react";


const Todo =({data, deletee}) =>{
	
	
	
	return(
		data.map((da)=>{
		return(
			<div >
			<h1 onClick={()=>{deletee(da.id)}}>{da.content}</h1>
			
		</div>
			
		)
		
		}))
	
}
export default Todo
